j `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2073763","type":"CustomJS"},{"attributes":{},"id":"2073543","type":"Selection"},{"attributes":{"logo":null,"toolbars":[{"id":"2073476"},{"id":"2073622"},{"id":"2073436"},{"id":"2073673"}],"tools":[{"id":"2073468"},{"id":"2073469"},{"id":"2073470"},{"id":"2073471"},{"id":"2073472"},{"id":"2073473"},{"id":"2073474"},{"id":"2073497"},{"id":"2073764"},{"id":"2073614"},{"id":"2073615"},{"id":"2073616"},{"id":"2073617"},{"id":"2073618"},{"id":"2073619"},{"id":"2073620"},{"id":"2073643"},{"id":"2073645"},{"id":"2073764"},{"id":"2073428"},{"id":"2073429"},{"id":"2073430"},{"id":"2073431"},{"id":"2073432"},{"id":"2073433"},{"id":"2073434"},{"id":"2073761"},{"id":"2073764"},{"id":"2073665"},{"id":"2073666"},{"id":"2073667"},{"id":"2073668"},{"id":"2073669"},{"id":"2073670"},{"id":"2073671"},{"id":"2073688"},{"id":"2073764"}]},"id":"2073835","type":"ProxyToolbar"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP9USKfC1tu4/LPoSXJdK7z8AcCp5TJ7xP7v31nmFRvI/Ux5kLOHR8z/TKDgkIcjzP82zt8mqR/M/7u8F/3Z99T94GQApwN/6P+4/88rymPk/HXlkXvY0+z9phJssv/X6PyFJQDtbrf0/pRrhDX0qAEB27Lf31fgAQNamsbzh3ABA/X9P2q15AEC2yXld1Wz/PwzA+symXv8/pm4Yqf8x/z8IyYrHhvf/P60KIG94RQBAInGOFnI+AE
